'''Spined armour''' is [[Fremennik armour]] for [[Combat classes#Ranger|rangers]] that can only be made by going to [[Waterbirth Island]]. It requires 40 [[Defence]] and [[Ranged]] to wear. Most of the set can only be worn after the completion of [[The Fremennik Trials]]. Parts of this armour can be dropped by [[Dagannoth Supreme]]. While wearing the full set, the title of "Spinewielder" is added to your [[Fremennik name]].

Spined armour may be placed in the [[Armour case]] in the [[Costume room]] of a [[player-owned house]], so players may own it without the armour taking up bank space.

==Making spined armour==
The raw materials for this armour are [[circular hide]]s (helm), [[stretched hide]]s (chaps) and [[flattened hide]]s (body). They are dropped by level 88 ranged [[Dagannoth (Waterbirth Island)|Dagannoths]], who also drop [[Spined gloves]] and [[Spined boots]]. Once you have the raw materials, the armour is made by [[Sigli the Huntsman]].

